// src/components/Navbar.js
import React from 'react';

const Navbar = ({ getUsers }) => {
  return (
    <nav>
      <div className="brand">Your Brand Name</div>
      <button onClick={getUsers}>Get Users</button>
    </nav>
  );
};

export default Navbar;
